def sum_unique_elements(lst):
    """"""
    unique_elements = set()
    sum_of_unique_elements = 0
    for i in range(len(lst) - 1, -1, -1):
        if lst[i] not in unique_elements:
            unique_elements.add(lst[i])
            sum_of_unique_elements += lst[i]
        else:
            lst.pop(i)
    return sum_of_unique_elements
